// import { useLocation } from 'react-router-dom';
import { Link, useLocation } from 'react-router-dom';
import css from './SelectPost.module.css';
import { useEffect, useState } from 'react';

import avatarImage from '../../images/avatar.png';
import FetchUserTiktokPosts from 'Api/FetchUserTikTokPosts';

const SelectPost = () => {
  const location = useLocation();
  const { uniqueId } = location.state;
  const [tiktokPosts, setTikTokPosts] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      await FetchUserTiktokPosts(uniqueId, setTikTokPosts);
    };

    fetchData();
  }, [uniqueId]);

  const [selectedOption, setSelectedOption] = useState('1');

  const handleOptionChange = event => {
    setSelectedOption(event.target.value);
  };
  return (
    <div className={css.selectPostsWrap}>
      <div className={css.selectPostsFirst}>
        <h1 className={css.selectTitle}>
          Select<span className={css.selectPostsSpn}>Post</span>
        </h1>
        <div className={css.selectPostsInfo}>
          Select{' '}
          <span className={css.selectPostsInfoSpn}>
            1 Post / 50 likes per post
          </span>
        </div>

        <div className={css.selectPosts}>
          {tiktokPosts?.data?.video &&
            tiktokPosts?.data?.video.map(({ cover, video_id, author }) => (
              <div key={video_id} className={css.findedUserWrap}>
                <img
                  className={css.findedUserImage}
                  src={cover}
                  alt="profile"
                />
                <div className={css.findedUserName}>{author}</div>
                <button className={css.getStartedRedirect} onClick={() => {}}>
                  Select
                </button>
              </div>
            ))}

          <label
            className={`${css.radioLabel} ${
              selectedOption === '1' ? css.active : ''
            } ${css.radioCrypto}`}
          >
            <input
              type="radio"
              name="option"
              value="1"
              checked={selectedOption === '1'}
              onChange={handleOptionChange}
              className={css.radioInput}
            />
            <span className={css.radioCustom}></span>
            <img className={css.selectedPostImg} src={avatarImage} alt="" />
          </label>
          <label
            className={`${css.radioLabel} ${
              selectedOption === '2' ? css.active : ''
            } ${css.radioCrypto}`}
          >
            <input
              type="radio"
              name="option"
              value="2"
              checked={selectedOption === '2'}
              onChange={handleOptionChange}
              className={css.radioInput}
            />
            <span className={css.radioCustom}></span>
            <img className={css.selectedPostImg} src={avatarImage} alt="" />
          </label>
          <label
            className={`${css.radioLabel} ${
              selectedOption === '3' ? css.active : ''
            } ${css.radioCrypto}`}
          >
            <input
              type="radio"
              name="option"
              value="3"
              checked={selectedOption === '3'}
              onChange={handleOptionChange}
              className={css.radioInput}
            />
            <span className={css.radioCustom}></span>
            <img className={css.selectedPostImg} src={avatarImage} alt="" />
          </label>
          <label
            className={`${css.radioLabel} ${
              selectedOption === '4' ? css.active : ''
            } ${css.radioCrypto}`}
          >
            <input
              type="radio"
              name="option"
              value="4"
              checked={selectedOption === '4'}
              onChange={handleOptionChange}
              className={css.radioInput}
            />
            <span className={css.radioCustom}></span>
            <img className={css.selectedPostImg} src={avatarImage} alt="" />
          </label>
          <label
            className={`${css.radioLabel} ${
              selectedOption === '5' ? css.active : ''
            } ${css.radioCrypto}`}
          >
            <input
              type="radio"
              name="option"
              value="5"
              checked={selectedOption === '5'}
              onChange={handleOptionChange}
              className={css.radioInput}
            />
            <span className={css.radioCustom}></span>
            <img className={css.selectedPostImg} src={avatarImage} alt="" />
          </label>
          <label
            className={`${css.radioLabel} ${
              selectedOption === '6' ? css.active : ''
            } ${css.radioCrypto}`}
          >
            <input
              type="radio"
              name="option"
              value="6"
              checked={selectedOption === '6'}
              onChange={handleOptionChange}
              className={css.radioInput}
            />
            <span className={css.radioCustom}></span>
            <img className={css.selectedPostImg} src={avatarImage} alt="" />
          </label>
          <label
            className={`${css.radioLabel} ${
              selectedOption === '7' ? css.active : ''
            } ${css.radioCrypto}`}
          >
            <input
              type="radio"
              name="option"
              value="7"
              checked={selectedOption === '7'}
              onChange={handleOptionChange}
              className={css.radioInput}
            />
            <span className={css.radioCustom}></span>
            <img className={css.selectedPostImg} src={avatarImage} alt="" />
          </label>
          <label
            className={`${css.radioLabel} ${
              selectedOption === '8' ? css.active : ''
            } ${css.radioCrypto}`}
          >
            <input
              type="radio"
              name="option"
              value="8"
              checked={selectedOption === '8'}
              onChange={handleOptionChange}
              className={css.radioInput}
            />
            <span className={css.radioCustom}></span>
            <img className={css.selectedPostImg} src={avatarImage} alt="" />
          </label>
        </div>
        <button className={css.loadMore}>
          <span>Load more posts</span>
        </button>
      </div>
      <div className={css.selectPostsSecond}>
        <div className={css.selectedInfo}>
          <img className={css.selectedImage} src={avatarImage} alt="avatar" />
          <div className={css.selectedName}>@k_gntv</div>
        </div>
        <Link className={css.selectedLink} to="/checkout">
          Continue to checkout
        </Link>
      </div>
    </div>
  );
};

export default SelectPost;
